import React, { Component } from 'react';

class Navbar extends  Component{
   render(){
       this.props = {first,second,third}
    return(
        <div>
           <ul>
               <li>{this.props.first}</li>
               <li>{this.props.second}</li>
               <li>{this.props.third}</li>
           </ul>
       </div>
    )      
   }
}

export default Navbar
